erences_text="Please send these recommendation questions to two current teachers and one current upper level school administrator. For applications to be reviewed, recommendations must be on official school letterhead and emailed to the Head of Admissions, Vicki G Wright (vwright@qf.org.qa), by Sunday, 22 November 2020. Please note that recommendations are confidential and should not be shared/viewed by parents and/or students.",r.recommendatio_questions_heading="Recommendation Questions",r.recommendatio_question_1="How long have you known this student?",r.recommendatio_question_2="Please explain to the selection committee why you are recommending this student?",r.recommendatio_question_3="What will this student bring to the Qatar Foundation community?",r.recommendatio_question_4="Do you have any reservations about this student’s academic abilities and character?",r.recommendatio_question_5="Any additional comments we should know about this student?",r.essay_topic="Upload essay",r.essay_topic_question="Why would you like to attend one of the Qatar Foundation schools and how will you contribute to our community?",r.essay_topic_text="The essay is often the most important part of your application; it gives the scholarship committee a sense of who you are and your dedication to your goals. You’ll want to make sure that your scholarship essay is the best it can possibly be.",r.essays_formatting_heading="Scholarship essays formatting:",r.essays_format_1="Double spaced",r.essays_format_2="Times New Roman font",r.essays_format_3="12-point font",r.essays_format_4="One-inch top, bottom, and side margins",r.other_useful_tips_heading="Other useful tips to keep in mind include",r.other_useful_tip_1="Think about what you are going to write and organize your thoughts into an outline.",r.other_useful_tip_2="Write your essay by elaborating on each point you included in your outline.",r.other_useful_tip_3="Use clear, concise, and simple language throughout your essay.",r.other_useful